import React from "react"

const MyItem = props => {
	return (
			<div className="card">
				<img 
					className="card-img-top"
					src={props.person.photo}
					alt=""
				/>
	        		<p>{props.person.name}</p>
	       			<button 
	       				type="button" 
	       				onClick={props.removePerson.bind(null, props.person)}>
	       			  		Delete person
	       			</button>
       		</div>
		);
};

export default MyItem
